 @miikael97  até hoje não entendo essas pessoas que dizem que o Flamengo Não tem estádio.
Tem Estádio Sim!!
Estádio Da Gavea.

Comparar clubes por número de títulos em um único campeonato é desmerecer a história do clube como um todo, amigo.

Flamengo tem:

• Mais Libertadores que o Corinthians - e isso já anula a sua afirmação - além de uma torcida mais numerosa também;
• Mais títulos nacionais que o Santos;
• Mais títulos nacionais que o São Paulo (principalmente quando se fala de Copa do Brasil);
• O mundial que o Palmeiras nunca conseguiu. 

Vou além e ainda digo: na primeira divisão do Brasil, o Flamengo tem a mesma tradição que Santos e São Paulo, enquanto Corinthians e Palmeiras já foram rebaixados. Todos os grandes paulistas e o Flamengo merecem respeito, pois todos têm sua história!

 @yulia9342  Santos não é o único merecedor de respeito, não. Para de ser fanática. Acha que teu time é o único que merece reconhecimento pela história? Acha que é o único que conquistou títulos, que deu alegria para seus torcedores? O mundo não gira em torno de você e do seu Clube. Aprenda a admirar o bom futebol em vez de ser cega unicamente por uma instituição. Veja o Galo, por exemplo, que apesar de estar conquistando um bicampeonato brasileiro, tem feito história com um timaço e um futebol bonito de ver. Eu tiro o chapéu para os caras, mesmo não sendo atleticano, pois não partilho desse mesmo fanatismo que você. Existem outros grandes no Brasil, queira você ou não, e Flamengo é um deles.
Deu pra ver que você é uma torcedora bastante emocionada. Desconsiderar Corinthians como Clube grande de São Paulo? Só aí você já perde toda a credibilidade no seu comentário. Quando você for mais racional e pé no chão, em vez de se deixar levar pela emoção de torcer por um Clube, aí a gente conversa. "Só o meu Santos tem história, o resto é tudo lixo!", disse a fanática. 

Ah, e antes que eu me esqueça, verdade seja dita sobre esse jogo: o Santos brigou para garantir a permanência na série A, enquanto o Flamengo só jogou pra cumprir tabela mesmo, pois a segunda colocação já foi garantida. E teve nada mais nada menos do que 13 desfalques. Simples assim.

